import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import Text from "./components/text";
const root = ReactDOM.createRoot(document.getElementById("root"));
let name = "ali";
let age = 17;
root.render(
  <>
    <Text name={name} age={age} />
  </>
);
